  {apply_id: 3, user_name: "최병재", point1: 15, point2: 20, point3: 15, point4: 20, point5: 13, point6: nil, point7: nil, point8: nil, point9: nil, point10: nil, comment: "열정 넘쳐서 좋네용"},
  {apply_id: 1, user_name: "최병재", point1: 5, point2: 10, point3: 10, point4: 15, point5: 6, point6: nil, point7: nil, point8: nil, point9: nil, point10: nil, comment: ""},
  {apply_id: 2, user_name: "최병재", point1: 20, point2: 20, point3: 15, point4: 15, point5: 13, point6: nil, point7: nil, point8: nil, point9: nil, point10: nil, comment: "한의학이라는 생소한 분야의 서비스라 좋았고, 저도 실은 처음에 App만드는줄 알고 왔었기 때문에 앱개발을 원하신다고 해서 점수를 줄이진 않았습니다. 웹을 배워서 토대로 앱을 배우면 되는거라 생각합니다."},
  {apply_id: 4, user_name: "최병재", point1: 20, point2: 20, point3: 10, point4: 5, point5: 1, point6: nil, point7: nil, point8: nil, point9: nil, point10: nil, comment: "열정은 넘치셔서 좋은데... \r\n'창업동아리의 회의는 거의 제가 주도하고 있습니다. 의견은 많겠지만, 회의중에 말도안되는 발언으로 물흐리는 일이 없도록 할 수 있습니다.' \r\n - 회의 중에 말도 안되는 발언으로 물을 흐린다.... 내 생각과 다르다고 해서 말도 안되는 발언이라고 표현하는게.... 팀워크에서 가장 불편하다고 생각되는 부분입니다.\r\n'앱 개발 수업을 하면서 잘한다는 칭찬을 자주 들어서 내 실력이 그정도인가? 하고 살~짝 기고만장해져 있기도 하지만'\r\n - 앞에 영향 덕분일 수도 있겠고, 정말 잘 하실 수도 있지만...."},
  {apply_id: 5, user_name: "최병재", point1: 15, point2: 15, point3: 10, point4: 10, point5: 1, point6: nil, point7: nil, point8: nil, point9: nil, point10: nil, comment: ""},
  {apply_id: 1, user_name: "박현민", point1: 8, point2: 15, point3: 12, point4: 14, point5: 5, point6: nil, point7: nil, point8: nil, point9: nil, point10: nil, comment: "빠르게 지원을 한 것에 하고자 하는 의지는 있는 것 같으나 그 외 것은 그닥.. 평범"},
  {apply_id: 6, user_name: "최병재", point1: 10, point2: 15, point3: 15, point4: 15, point5: 6, point6: nil, point7: nil, point8: nil, point9: nil, point10: nil, comment: ""},
  {apply_id: 7, user_name: "최병재", point1: 20, point2: 15, point3: 15, point4: 20, point5: 13, point6: nil, point7: nil, point8: nil, point9: nil, point10: nil, comment: ""},
  {apply_id: 2, user_name: "박현민", point1: 18, point2: 15, point3: 5, point4: 17, point5: 18, point6: nil, point7: nil, point8: nil, point9: nil, point10: nil, comment: "나름대로의 의지와 성실함?이 보인 것 같습니다. 직접만나봐서 얘기해보고 싶은 사람이라 생각."},
  {apply_id: 3, user_name: "박현민", point1: 17, point2: 20, point3: 17, point4: 18, point5: 17, point6: nil, point7: nil, point8: nil, point9: nil, point10: nil, comment: "굳이 창의성이 높고 잘할 것 같은 것 보다. 멋사에 대한 의지가 보이고 나름대로의 이유와 깔끔한 정리가 좋았어요. 게임 개발에 대한 내용이 개인적으로 좀 공감이되던.. 근데 RICH분이시구나..ㅋㅋㅋ"},
