  {apply_id: 6, user_name: "박현민", point1: 11, point2: 19, point3: 17, point4: 20, point5: 12, point6: nil, point7: nil, point8: nil, point9: nil, point10: nil, comment: "자소서를 쓰며 겪은 고민의 흔적이 많이 보이는 것 같습니다. 신중하게 쓰신 것 같고.. 멋사에 어울리는 취지를 가진 지원자라고 생각되네요. 멋사에서 웹 중심으로 배우며 진행되지만 앱을 만들기전에 웹으로 공부를 하며 먼저 아이디어 구현을 해보는 방법도 좋은 것 같으니.. 괜찮을 것 같네요."},
